import React from "react";
import { Button } from "@material-tailwind/react";

const test = () => {
  return (
    <div className="">
      <form action="">
        <div className="addProduct-navbar">
          <h4>Product Form</h4>
          <div className="navbar-button">
            <Button variant="contained" className="text-white bg-blue-600">
              Filter
            </Button>
            <Button variant="contained" className="text-black">
              Create
            </Button>
          </div>
        </div>
      </form>
    </div>
  );
};

export default test;
